import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom";
import HomePage from './pages/home-page/HomePage';
import Header from './components/header/Header';

function App() {
  return (<>
    <BrowserRouter>
    <Header />
      <Routes>
        <Route path="/" element={<HomePage />}/>
      </Routes>
    </BrowserRouter>
  </>);
}

export default App;
